volas forviŝi personajn informojn el la elektitaj mendoj?','shipping packagesShipping %d'=>'Senda %d','Shipping Address'=>'Senda adreso','Billing Address'=>'Faktura adreso','Shipping Address 1'=>'Senda adreso 1','Billing Address 1'=>'Faktura adreso 1','Payer PayPal address'=>'PayPal-adreso de paganto','Payer last name'=>'Familia nomo de paganto','Payer first name'=>'Persona nomo de paganto','MySQL version string.'=>'Versia linio de MySQL.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Via CSV bezonas inkluzivi kolumnojn specife ordigitaj. %1$sAlklaku tie por elŝuti ekzemplon%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'Tio estos la aspekto de via nomo en la konta sekcio kaj en recenzoj','If you have a coupon code, please apply it below.'=>'Se vi havas kuponkodon, bonvole enigu ĝin sube.','terms and conditions'=>'uzkondiĉoj','privacy policy'=>'privateca politiko','United States (US) dollar'=>'Usona dolaro','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal permesas al ni sendi unu adreson. Se vi uzas PayPal por adres-etikedoj, vi eble volas sendi la sendadreson prefere ol la fakturan. Malebligo de tiu opcio eble preventos aplikon de Venda protekto de PayPal.','eCheck ending in %1$s'=>'eĈeko finiĝanta per %1$s','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Normala alidirektas klientojn al PayPal por la enigo de pagaj informoj.','Other locations'=>'Aliaj lokoj','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Iu metodo &quot;%1$s&quot;','Account details:'=>'Detaloj de konto:','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'pri,estas,kiel,ĉe,esti,de,com,por,kiel,en,sur,aŭ,al,ĝis,la,tiu,ĉi,estis,estos,kio,kiu,kiam,kie,kun,tiu,tio,tiam,pro,ĉar,je,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Se vi volas, aldonu tekston por la markskatolo pri uzkondiĉoj kiujn klientoj devas akcepti.','%s page'=>'Paĝo %s','No page set'=>'Neniu paĝo fiksita','Highlight required fields with an asterisk'=>'Emfazo de devigaj kampoj per steleto','Required'=>'Deviga','%s field'=>'Kampo %s','These options let you change the appearance of the WooCommerce checkout.'=>'Tiu opcioj permesas vin ŝanĝi la aspekton de la pagprocezo de WooCommerce.','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Vi povas akcepti pagojn fizike per ĉekoj. Tiu eksterreta pagoservo povas ankaŭ esti utila por testi aĉetojn.','I have read and agree to the website %s'=>'Mi legis kaj akceptas la retejan %s','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Bonvole vidu la <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">privatecan politikon de PayPal</a> por pliaj detaloj.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Ni akceptas pagojn per PayPal. Dum pritrakto de pagoj, kelkaj viaj datumoj estos liveritaj al PayPal, inkluzive informojn bezonajn por pritrakti aŭ subteni la pagon, kiel la sumon de la aĉeto kaj fakturajn informojn.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Vi povas akcepti pagojn fizike per BACS. Pli ofte konata kiel rekta banka/elektronika ĝiro','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'En tiu subsekcio vi devus listigi la eksterajn pagoservojn kiujn vi uzas por akcepti pagojn ĉe via retejo, ĉar ili eble pritraktas klientajn datumojn. Ni inkluzivis PayPal kiel ekemplon, sed vi devus forviŝi tion se vi ne uzas PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Ni dividas informojn kun eksteraj partneroj kiuj helpas nin plenumi mendojn kaj servojn al vi; ekzemple --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'En tiu sekcio, vi devus listigi al kiuj vi dividas informojn kaj kial. Tiuj povus inkluzivi, sed ne necese estas limigitaj al, analiziloj, merkataj servoj, pagoservoj, ekspedistoj kaj liveristoj de enkorpigaĵoj.','What we share with others'=>'Kion ni dividas kun aliaj','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'La anoj de nia teamo rajtas aliri la informojn por helpi plenumi mendojn, pritrakti repagojn kaj helpi vin.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Anoj de nia teamo rajtas aliri la informojn donitajn de ni al vi. Ekzemple, kaj administrantoj kaj direktistoj de la vendejo povas aliri al:','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Mendaj informoj kiel la ero aĉetita, kiam la aĉeto okazis kaj kien ĝi estu sendita kaj','Customer information like your name, email address, and billing and shipping information.'=>'Klientaj informoj kiel viaj nomo, retpoŝtadreso kaj fakturaj kaj sendaj informoj.','Who on our team has access'=>'Kiuj teamanoj rajtas aliri','We will also store comments or reviews, if you choose to leave them.'=>'Ankaŭ, ni tenos komentojn aŭ recenzojn, se vi elektos lasi tiujn.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Kutime, ni tenas informojn pri vi tiom longe, kiom ni bezonas la informojn por niaj kolektaj kaj uzaj celoj, kaj ni ne estas laŭleĝe devigitaj daŭre teni ilin. Ekzemple, ni tenas informojn pri mendoj dum XXX jaroj por impostaj kaj librotenadaj uzoj. Tiuj inkluzivas viajn nomon, retpoŝtadreson kaj fakturan kaj sendan adresojn.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Se vi kreos konton, ni tenos viajn nomon, retpoŝtadreson kaj telefonnumeron, kiuj estos metitaj en kampojn dum pagoj de estontaj mendoj.','Send you marketing messages, if you choose to receive them'=>'sendi al vi merkatajn mesaĝojn, se vi elektos ricevi ilin','Improve our store offerings'=>'plibonigi tiujn, kiujn nia vendejo ofertas','Comply with any legal obligations we have, such as calculating taxes'=>'observi iujn leĝajn devojn de ni, kiel kalkulon de impostoj','Set up your account for our store'=>'starigi vian konton ĉe nia retejo','Process payments and prevent fraud'=>'pritrakti pagojn kaj preventi fraŭdon','Respond to your requests, including refunds and complaints'=>'respondi al viaj petoj, inkluzive repagojn kaj plendojn','Send you information about your account and order'=>'sendi al vi informojn pri viaj konto kaj mendo','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kiam vi aĉetos de ni, ni petos vin doni informojn inkluzive viajn nomon, fakturan adreson, sendan adreson, retpoŝtadreson, telefonnueron, kreditkartajn/pagajn detalojn kaj laŭvolajn kontajn informojn kiel uzantnomon kaj pasvorton. Ni uzos tiujn informojn, i.a., por:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Notu: vi eble volas aldoni pliajn detalojn al via kuketa politiko kaj ligi al tiu sekcio de tie ĉi.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Ankaŭ, ni uzos kuketojn por teni en memoro la enhavon de korbo dum vi foliumos tra nia retejo.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Senda adreso: ni petos vin doni tiun por ke ni povu, ekzemple, taksi sendokoston antaŭ meto de via mendo kaj por sendi la mendon!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokon, IP-adreson kaj tipon de retumilo: ni uzos tiujn cele al kalkulo de impostoj kaj sendokostoj','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Varojn rigarditajn de vi: ni uzos tion ekzemple, por montri al vi varojn lastatempe rigarditajn de vi','While you visit our site, we’ll track:'=>'Dum vi vizitas nian retejon, ni spuros:','What we collect and store'=>'Kion ni kolektas kaj tenas','We collect information about you during the checkout process on our store.'=>'Ni kolektas informojn pri vi dum la paga procezo ĉe nia retejo.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Tiu ĉi specimena teksto inkluzivas bazajn aferojn rilate al kiuj personaj datumoj estas kolektataj, tenataj kaj kunhavigataj, kaj ankaŭ kiuj eble rajtas aliri tiujn informojn. Depende de agordoj kaj uzataj aldonaj kromprogramoj, la apartaj informoj kunhavigitaj de via vendejo varios. Ni rekomendas konsulton kun advokato dum decido de tio, kion vi devus enskribi en via privateca politiko.','Browser User Agent'=>'Retumilo uzita','Items Purchased'=>'Eroj aĉetitaj','Access granted'=>'Aliro donita','Order Number'=>'Mendo-numero','Download count'=>'Tuto de elŝutoj','User email'=>'Retpoŝtadreso de uzanto','Token'=>'Ĵetono','Payment Tokens'=>'Pagaj ĵetonoj','Personal data removed.'=>'Personaj informoj forviŝitaj.','Shipping Postal/Zip Code'=>'Senda poŝtkodo','Shipping City'=>'Senda urbo','Shipping Company'=>'Senda firmao','Shipping Last Name'=>'Senda famili-nomo','Shipping First Name'=>'Senda persona nomo','Phone Number'=>'Telefonnumero','Billing State'=>'Faktura ŝtato','Billing Postal/Zip Code'=>'Faktura poŝtkodo','Billing City'=>'Faktura urbo','Billing Company'=>'Faktura firmao','Billing Last Name'=>'Faktura famili-nomo','Billing First Name'=>'Faktura persona nomo','display name%1$s %2$s'=>'%1$s %2$s','Please read and accept the terms and conditions to proceed with your order.'=>'Bonvole legu kaj akceptu la uzkondiĉojn por daŭrigi en la mendo.','Unserializing instances of this class is forbidden.'=>'Senseriigo de okazoj de tiu ĉi klaso estas malpermesita.','Cloning is forbidden.'=>'Klonado estas malpermesita.','Deleted all active sessions, and %d saved carts.'=>'Forviŝis ĉiujn aktivajn seancojn kaj %d konservitajn korbojn.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Tiu ilo forviŝos ĉiujn datumojn pri klientaj seancoj el la datumbazo, inkluzive de nunaj korboj kaj korboj konservitaj en la datumbazo.','If the payment was refunded via the API.'=>'Se la pago estis repagita per la API.','Order total formatted for locale'=>'Sumo de mendo aranĝita laŭ lokaĵo','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s estis forigita el via korbo ĉar ĝi poste ŝanĝiĝis. Vi povas remeti ĝin en vian korbon <a href="%2$s">tie</a>.','Shipping State'=>'Senda ŝtato','Download ID'=>'ID de elŝuto','Customer Data'=>'Datumoj de kliento','Error during status transition.'=>'Eraro dum transiro de stato.','Update status event failed.'=>'Malsukcesis ĝisdatigi staton.','Payment complete event failed.'=>'Malsukcesis finfari pagon.','optional'=>'nedeviga','Display name'=>'Montronomo','Display name cannot be changed to email address due to privacy concern.'=>'Montronomo ne povas esti ŝanĝita al retpoŝtadreso pro zorgo pri privateco.','Name of the customer for the order'=>'Nomo de la kliento, por la mendo','URL to edit the order'=>'URL por redakti la mendon','Blog id of the record on the multisite.'=>'Blog-ID de la rikordo ĉe la multretejo.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Ŝajnas, ke via retejo ne estas sekure konektita. Ni forte rekomendas servadon de via tuta retejo pere de HTTPS-konektiĝo por helpi sekurigi datumojn de klientoj. <a href="%s">Lernu pli tie.</a>','Access to Purchased Downloads'=>'Aliro al aĉetitaj elŝutaĵoj','Purchased Downloads'=>'Aĉetitaj elŝutaĵoj','Removed payment token "%d"'=>'Forviŝis pagan ĵetonon "%d"','Customer download permissions have been retained.'=>'Elŝutaj permesoj de kliento estas tenataj.','Removed access to downloadable files.'=>'Forviŝis aliron al elŝuteblaj dosieroj.','Personal data within order %s has been retained.'=>'Tenis personajn informojn ene de mendo %s.','Removed personal data from order %s.'=>'Forviŝis personajn informojn de mendo %s.','Removed customer "%s"'=>'Forviŝis klienton "%s"','User roleShop manager'=>'Vendeja direktisto','User roleCustomer'=>'Kliento','Unable to create order.'=>'Ne povis krei mendon.','%d permissions deleted'=>'%d permesoj forviŝitaj','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Tiu ilo forviŝos eksvalidajn elŝutajn permesojn kaj permesojn kun 0 restantaj elŝutoj.','Clean up download permissions'=>'Purigi elŝutajn permesojn','Used-up download permissions'=>'Elĉerpitaj elŝutaj permesoj','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Limigi rezultaron al varoj kun specifa atributo. Uzi taksonomian nomon/atributan urlnomon.','WooCommerce pages'=>'Paĝoj de WooCommerce','WooCommerce database version'=>'Datumbaza versio de WooCommerce','Settings tab labelPayments'=>'Pagoj','Enable coupons'=>'Ebligo de kuponoj','Rates will be configurable and taxes will be calculated during checkout.'=>'Tarifoj estos difineblaj kaj impostoj estos kalkulitaj dum la paga procezo.','Enable tax rates and calculations'=>'Ebligo de imposto-tarifoj kaj kalkuloj','Manage'=>'Administri','Account endpoints'=>'Kontaj finadresoj','Secure checkout'=>'Sekura pagprocezo','Legacy API'=>'Malnova API','Displays whether or not WordPress is using an external object cache.'=>'Montras ĉu WordPress uzas eksteran objektan kaŝmemoron.','External object cache'=>'Ekstera objekta kaŝmemoro','WordPress cron'=>'WordPress-cron','WordPress debug mode'=>'Senerariga reĝimo de WordPress','WordPress memory limit'=>'Memorlimo de WordPress','WordPress multisite'=>'Multretejo de WordPress','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Pli nova versio de WordPress estas havebla (%2$s)','WordPress version'=>'Versio de WordPress','WooCommerce version'=>'Versio de WooCommerce','Retain cancelled orders'=>'Teni nuligitajn mendojn','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Malsukcesaj mendoj ne estas pagitaj kaj eble estis neglektitaj de la kliento. Ili eniros rubujon post la specifita tempodaŭro.','Retain failed orders'=>'Teni malsukcesajn mendojn','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Pritraktotaj mendoj ne estas pagitaj kaj eble estis neglektitaj de la kliento. Ili eniros rubujon post la specifita tempodaŭro.','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Teni finfaritajn mendojn dum specifita tempodaŭro antaŭ sennomigo de la enhavantaj personaj informoj.','Retain completed orders'=>'Teni finfaritajn mendojn','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Nuligitaj mendoj ne estas pagitaj kaj eble estis nuligitaj de la posedanto de la retejo aŭ la kliento. Ili eniros rubujon post la specifita tempodaŭro.','Accounts &amp; Privacy'=>'Kontoj k. Privateco','Optionally add some text about your store privacy policy to show during checkout.'=>'Se vi volas, aldonu tekston pri la privateca politiko de via retejo, por montri dum la paga procezo.','Checkout privacy policy'=>'Privateca politiko je la paga procezo','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Se vi volas, aldonu tekston pri la privateca politiko de via retejo, por montri ĉe kontaj registriĝaj formularoj.','Registration privacy policy'=>'Privateca politiko je la registriĝo','Privacy policy'=>'Privateca politiko','Filter by registered customer'=>'Filtri laŭ registrita kliento','Remove personal data'=>'Forviŝi personajn datumojn','Use previous column mapping preferences?'=>'Ĉu uzi antaŭajn preferojn por mapigo de kolumnoj?','Retain pending orders '=>'Teni pritraktotajn mendojn','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Neaktivaj kontoj estas tiuj, kiuj ne ensalutis, nek metis mendon dum la specifita tempodaŭro. Ili estos forviŝitaj. Iuj mendoj estos konvertitaj al mendoj de gastoj.','Retain inactive accounts '=>'Teni neaktivajn kontojn','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Elektu kiom longe personaj informoj estu tenataj kiam ili ne plu estas bezonaj por traktado. Lasu la sekvajn opciojn malplenaj por teni tiujn informojn senlime.','Personal data retention'=>'Tenado de personaj informoj','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Viaj personaj informoj estos uzataj por pritrakti vian mendon, helpi vian sperton en tiu ĉi retejo kaj aliaj celoj priskribitaj en nia %s.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Viaj personaj informoj estos uzataj por helpi vian sperton en tiu ĉi retejo, regi aliron al via konto kaj aliaj celoj priskribitaj en nia %s. ','Account erasure requests'=>'Petoj forviŝi konton','Allowed emails'=>'Akceptitaj retpoŝtadresoj','privacy page'=>'privateca paĝo','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Tiu sekcio regas la montradon de la privateca politiko de via retejo. La subaj sciigoj pri privateco ne aperos escepte se %s estas asignita.','Removed personal data from %s order.'=>'Forviŝi personajn informojn de %s mendo.' . "\0" . 'Forviŝi personajn informojn de %s mendoj.','List of allowed billing emails to check agains