pon'=>'Krei vian unuan kuponon','Existing products that match by ID or SKU will be updated. Products that do not exist will be skipped.'=>'Ekzistantaj varoj, kiuj kongruas laŭ ID aŭ stok-numero, SKU, estos ĝisdatigitaj. Neekzistantaj varoj estos ignoritaj.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Por ricevi ĝisdatigojn kaj subtenon por tiu etendaĵo, vi bezonas <strong>aĉeti</strong> novan abonon aŭ kunligi ĉiujn viajn etendaĵojn al unu konektita konto per <strong><a href="%1$s" title="Sharing Docs">kunhavigo</a> aŭ <a href="%2$s" title="Transferring Docs">transdono</a></strong> de tiu etendaĵo al tiu konektita konto.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'La kromprogramo Helpilo de WooCommerce ne plu necesas. Anstataŭe <a href="%s">administru abonojn</a> de la langeto pri Etendaĵoj.','Continue with Jetpack'=>'Daŭrigi uzante Jetpack','payment setup'=>'agordoj de pago','payment setup and automated taxes'=>'agordoj de pago kaj aŭtomataj impostoj','Delete "%s" permanently'=>'Porĉiame forviŝi "%s"','Reasons you\'ll love Jetpack'=>'Kialoj ami Jetpack','Webhook topic unknown. Please select a valid topic.'=>'Rethoka temo nekonata. Bonvolu elekti validan temon.','Direct payments to email address:'=>'Sendo de pagoj al retpoŝtadreso:','Square'=>'Square','Klarna Payments'=>'Klarna-pagoj','Klarna Checkout'=>'Pagprocezo de Klarna','Email address to receive payments'=>'Retpoŝtadreso por ricevi pagojn','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Vi povas elekti la tipon 