ted with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Atentu!</strong> La versioj de la sekvaj kromprogramoj, kiujn vi uzas, ne estis testitaj uzante WooCommerce %s. Bonvolu ĝisdatigi ilin aŭ konfirmi kongruon antaŭ ĝisdatigo de WooCommerce, por ne sperti problemojn:','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'La sekvaj aktivaj kromprogramoj ankoraŭ ne deklaris kongruon kun WooCommerce %s kaj estu ĝisdatigitaj kaj kontrolitaj antaŭ daŭrigo:','%s fee'=>'%s tarifo','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Tie estas la loko de via komercejo. Impostaj tarifojoj kaj sendaj tarifoj estos kalkulitaj laŭ tiu adreso.','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'La stoko ne estis ĝisdatigita ĉar la nombro ŝanĝiĝis ekde redakto. Estas %2$d ekzempleroj de la varo %1$d.','Upload a new file'=>'Alŝuti novan dosieron','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'La dosiero estas malplena aŭ uzas alian kodigon ol UTF-8, bv. provi denove per nova dosiero.','Lifetime Subscription'=>'Dumviva abono','Position'=>'Pozicio','Sort by:'=>'Ordigi laŭ:','Refund #%1$s - %2$s by %3$s'=>'Repago #%1$s - en la %2$s, de %3$s','Add shipping'=>'Aldono de sendokosto','Choose an action...'=>'Elektu agon...','Order details manually sent to customer.'=>'Mendaj detaloj senditaj al kliento permane.','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Sube estas listo de etendaĵoj haveblaj por via konto de WooCommerce.com. Por ricevi ĝisdatigojn al etendaĵoj, certiĝu ke la etendaĵo estas fakte instalita, la abono estas aktiva kaj ke ĝi estas konektita al via konto de WooCommerce.com. Aktivigo de etendaĵoj okazas ĉe la ekrano <a href="%s">Kromprogramoj</a>.','Update Available'=>'Ĝisdatigo havebla','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Se plaĉas al vi %1$s, bonvolu doni pritakson de %2$s. Antaŭdankon!','Expired'=>'Eksvalidiĝis','Expiring Soon'=>'Eksvalidiĝos baldaŭ','Transfer existing products to your new store — just import a CSV file.'=>'Transmeto de ekzistantaj varoj al via nova vendejo  — simple importu CSV-dosieron.','Create a product'=>'Krei novan varon','Have an existing store?'=>'Ĉu vi havas ekzistantan vendejon?','Import products'=>'Importi varojn','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Ni subtenas vin  — vi povas ricevi novaĵojn pri varoj, kaj inspiradon rekte al via leterkesto.','Yes please!'=>'Jes, bonvole!','You\'re ready to start selling!'=>'Vi estas preta por oferti!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Via retejo eble estas sur privata reto. Jetpack povas konektiĝi al nur publikaj retejoj. Bonvolu certigi videblecon de via retejo sur la interreto kaj poste provi denove konektiĝi 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Pardonon! Ni provis, sed ni ne povis kontakti Jetpack 😭. Bonvolu kontroli, ĉu via retejo estas videbla interrete, kaj ke ĝi akceptas kaj venantajn kaj elirantajn petojn per curl. Vi ankaŭ povus provi konektiĝi denove al Jetpack, kaj se vi spertas pliajn p