ulate tax.'=>'Tiu opcio decidas, kiu adreso estas uzita por kalkuli imposton.','No, I will enter prices exclusive of tax'=>'Ne, mi enigos prezojn sen imposto','Yes, I will enter prices inclusive of tax'=>'Jes, mi enigos prezojn inkluzivante imposton','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Tiu opcio estas grava ĉar ĝi influos kiel vi enigos prezojn. Ŝanĝo de tio ne influos  ekzistantajn varojn.','Prices entered with tax'=>'Prezoj enigitaj kun imposto','Save webhook'=>'Konservi rethokon','Created at'=>'Kreita je','Access restriction'=>'Limigo al aliro','Redirect only'=>'Alidirekto nur','X-Accel-Redirect/X-Sendfile'=>'X-Accel-Redirect/X-Sendfile','Force downloads'=>'Devigi elŝutojn','File download method'=>'Metodo de dosier-elŝuto','Stock display format'=>'Aranĝo de stoko-montrado','Out of stock visibility'=>'Videbleco de elĉerpitaĵoj','Out of stock threshold'=>'Sojlo por elĉerpiteco','Low stock threshold'=>'Sojlo por malmulta stoko','Hold stock (minutes)'=>'Teni stokon (minutoj)','Add payment method'=>'Aldoni pagmetodon','Pay'=>'Pagi','Force HTTP when leaving the checkout'=>'Devigi HTTP je foriro de la pagprocezo','Force secure checkout'=>'Devigi sekuran pagprocezon','Compound'=>'Kunmetita','Rate&nbsp;%'=>'Tarifo&nbsp;%','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'Urboj por ĉi tiu regulo. Punktokomo (;) apartigas plurajn valorojn. Lasu malplena por apliki al ĉiuj urboj.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'2-cifera ŝtata kodo, ekz. AL. Lasu malplena por apliki al ĉiuj.','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'2-cifera landa kodo, ekz. US. Lasu malplena por apliki al ĉiuj.','QRCode'=>'QR-kodo','Consumer secret'=>'Sekreto de la kliento','Copy'=>'Kopii','Consumer key'=>'Ŝlosilo de kliento','When applying multiple coupons, apply the first coupon to the full price and the second coupon 