doni al konduto de korbo','Coupons can be applied from the cart and checkout pages.'=>'Kuponoj povas esti aplikitaj de la korba kaj pagproceza paĝoj.','Notification recipient(s)'=>'Ricevonto(j) de sciigo','Notifications'=>'Sciigoj','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Finadresoj estas aldonitaj al la URLoj de viaj paĝoj por trakti specifajn agojn dum la pagprocezo. Ili estu unikaj.','Checkout endpoints'=>'Pagprocezaj finadresoj','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Se vi difinas paĝon "Uzkondiĉoj", dum la pagprocezo la kliento estos demandata pri akcepto de la kondiĉoj.','Cart page'=>'Korbopaĝo','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Ĉi tiuj paĝoj devas esti agorditaj, por ke WooCommerce sciu, kien sendi uzantojn por la pagprocezo.','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Opcie decidu la impostkategorion, kiun havu sendo, aŭ lasu ĝin, por ke sendimposto estu bazita sur la eroj en la korbo mem.','Choose which countries you want to ship to, or choose to ship to all locations you sell to.'=>'Elekto de landoj, al kiu sendi varojn, aŭ elekto sendi al ĉiuj landoj al kiuj vi ofertas.','This option lets you limit which countries you are willing to sell to.'=>'Tiu opcio permesas limigon de landoj, al kiuj vi volas vendi varojn.','Get system report'=>'Ricevi sisteman raporton','Choose whether or not this tax rate also gets applied to shipping.'=>'Elektu, ĉu tiu impostotarifo estu aplikita ankaŭ al sendado.','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'Elektu, ĉu tio estas kunmetita tarifo. Kunmetitaj impostaj tarifoj estos aplikitaj poste kaj aldone al apliko de aliaj impostaj tarifoj.','Tax rate ID.'=>'ID de impostotarifo.','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Elektu prioritaton por tiu impostotarifo. Nur 1 kongrua tarifo por ĉiu prioritato estos uzita. Por difini plurajn impostajn tarifojn por unu loko, vi devas specifi malsaman prioritaton por ĉiu tarifo.','Enter a name for this tax rate.'=>'Enigu nomon por tiu impostotarifo.','Enter a tax rate (percentage) to 4 decimal places.'=>'Enigu impostotarifon (elcento) ĝis 4 dekumaj ciferoj.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Tio agordas la valuton, en kiu prezoj estas listigitaj en la katalogo, kaj la valuton en kiu pagservoj akceptos pagojn.','Currency'=>'Valuto','This controls the position of the currency symbol.'=>'Ĉi tio agordas la pozicion de la valuta simbolo.','Currency options'=>'Valutaj opcioj','Please copy and paste this information in your ticket when contacting support:'=>'Bonvolu kopii kaj glui ĉi tiun informon al via petoslipo, kiam vi kontaktas subtenon:','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Difinu tekston por montri post viaj varaj prezoj. Ĉi tio povus esti, ekzemple,  "kun Valor-Aldona Imposto" por klarigi viajn prezojn. Vi povas ankaŭ inkluzivi prezojn ĉi tie uzante unu el la sekvaj: {price_including_tax}, {price_excluding_tax}.','Shipping tax class'=>'Klaso de sendimposto','Action event'=>'Ago-okazo','Customer deleted'=>'Kliento forviŝita','Import CSV'=>'Importi CSV','Remove selected row(s)'=>'Forviŝi elektita(j)n vico(j)n','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'Enŝaltu tiun opcion por doni alirorajton al elŝutoj, kiam mendoj estas "pritraktataj"